        #region DeepCopyIn
        public void DeepCopyIn(
            IBone item,
            IBoneGetter rhs,
            ErrorMaskBuilder? errorMask,
            TranslationCrystal? copyMask,
            bool deepCopy)
        {
            if ((copyMask?.GetShouldTranslate((int)Bone_FieldIndex.Name) ?? true))
            {
                item.Name = rhs.Name;
            }
            if ((copyMask?.GetShouldTranslate((int)Bone_FieldIndex.Values) ?? true))
            {
                errorMask?.PushIndex((int)Bone_FieldIndex.Values);
                try
                {
                    if ((rhs.Values != null))
                    {
                        item.Values = 
                            rhs.Values
                            .ToExtendedList<Single>();
                    }
                    else
                    {
                        item.Values = null;
                    }
                }
                catch (Exception ex)
                when (errorMask != null)
                {
                    errorMask.ReportException(ex);
                }
                finally
                {
                    errorMask?.PopIndex();
                }
            }
            if ((copyMask?.GetShouldTranslate((int)Bone_FieldIndex.BMMP) ?? true))
            {
                if(rhs.BMMP is {} BMMPrhs)
                {
                    item.BMMP = BMMPrhs.ToArray();
                }
                else
                {
                    item.BMMP = default;
                }
            }
            DeepCopyInCustom(
                item: item,
                rhs: rhs,
                errorMask: errorMask,
                copyMask: copyMask,
                deepCopy: deepCopy);
        }
        
        partial void DeepCopyInCustom(
            IBone item,
            IBoneGetter rhs,
            ErrorMaskBuilder? errorMask,
            TranslationCrystal? copyMask,
            bool deepCopy);
